function ({item, times, reset}, {ok}, {onError}) {
  if (typeof reset !== "undefined") {
    state.set("val", 0);
    return;
  }

  const curr = (state.get("val") || 0) + 1;
  state.set("val", curr);
  if (curr >= times) {
    adv.onError(new Error(`Limit of ${times} reached`));
  } else {
    setTimeout(() => {
      ok.next(item);
    }, 200);
  }
}
